import React from "react";

export default function SearchResults(props) {
  return (
    <>
      <p>Search Results</p>
      <ul>
        {!props.movieError
          ? props.results.map((movie) => (
              <li>
                {movie.Title}, {movie.Year}
              </li>
            ))
          : "Movie Not Found"}
      </ul>
    </>
  );
}
